import React, { Component } from 'react';

class Frisst extends Component {
    render() { 
        const name = ["navid","mansuri","rafik bhai"]

        return ( 
            <div>
               {
                   name.map(name => <h1>{name[0]}</h1>)
               }
            </div>
         );
    }
}

export default Frisst;
